import Link from 'next/link';
const Home = () => (
	<div>
		<ul>
			<li><Link href="/login"><a>Login</a></Link></li>
			<li><Link href="/signup"><a>Signup</a></Link></li>
		</ul>
		<div class="title">
			<h5>Welcome to weather app</h5>
		</div>
		<style jsx>{`
			ul {
				background: #333;
				display: flex;
				list-style: none;
				margin: 0px;
				padding: 10px;
			}
			ul li {
				font-size: 18px;
				margin-right: 10px;
			}
			ul li a {
				color: white;
				text-decoration: none;
			}
			.title {
				text-align: center
			}
		`}
		</style>
	</div>
)

export default Home;
